"""Menor caminho"""

#É preciso um gráfico e os acenos de início e fim como argumentos. 
def find_path(graph, start, end, path=[]):

        #Ele tenta cada possibilidade por sua vez até encontrar uma solução.
        path = path + [start]
        if start == end:
            return path

        #Quando nenhum caminho pode ser encontrado, ele retorna nenhum.
        for node in graph[start]:
            if node not in path:
                newpath = find_path(graph, node, end, path)
                if newpath: return newpath
        return None

#Saída
find_path(graph, 'Assis', 'Santa Cruz')

"""**DFS - Busca em Profundidade**"""

def dfs(visited, graph, node):

    #Mostrar nó que está sendo visitado e colocar na lista
    if node not in visited:
        print (node)
        visited.add(node)
        for neighbour in graph[node]:
            dfs(visited, graph, neighbour)

